func MassInsert_InvalidateCache(rows []InvalidateCache, db XODB) error {
	if len(rows) == 0 {
		return errors.New("rows slice should not be empty - inserted nothing")
	}
	var err error
	ln := len(rows)

	// insVals_:= strings.Repeat(s, ln)
	// insVals := insVals_[0:len(insVals_)-1]
	insVals := helper.SqlManyDollars(2, ln, true)
	// sql query
	sqlstr := "INSERT INTO sun_internal.invalidate_cache (" +
		"OrderId, CacheKey" +
		") VALUES " + insVals

	// run query
	vals := make([]interface{}, 0, ln*5) //5 fields

	for _, row := range rows {
		// vals = append(vals,row.UserId)
		vals = append(vals, row.OrderId)
		vals = append(vals, row.CacheKey)

	}

	if LogTableSqlReq.InvalidateCache {
		XOLog(sqlstr, " MassInsert len = ", ln, vals)
	}
	_, err = db.Exec(sqlstr, vals...)
	if err != nil {
		if LogTableSqlReq.InvalidateCache {
			XOLogErr(err)
		}
		return err
	}

	return nil
}

